1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=67ZigFVqnu0AX8gr1Yd\u0026edm=ABZsPhsAAAAA\u0026ccb=7-4\u0026oh=c23b18bcb09c6ef638ad03c599574d3c\u0026oe=60712C7F\u0026_nc_sid=4efc9f","config_width":640,"config_height":640}],"is_video":true,"accessibility_caption":null,"product_type":"feed","video_view_count":111}},{"node":{"comments_disabled":false,"__typename":"GraphSidecar","id":"2546415161578561006","edge_media_to_caption":{"edges":[{"node":{"text":"I am very fond of studying the design aspects of cars and their signature design elements. And so I was really looking forward to driving the Jaguar I-PACE. \n\nAs I was researching the design of the I-PACE, I came across an article that totally won me over. It mentioned that while designing electric vehicles, one could throw the rulebook out. \n\nThe all-electric Jaguar I-PACE is one such vehicle that pushes the boundaries of design.  The aerodynamic exterior of the I-PACE is dramatic and extremely eye-catching. \n\nThe vehicle\u2019s spacious interior and long wheelbase offer luxurious legroom for five adults and abundant, innovative storage solutions for luggage and other essentials. Its floating centre console and panoramic roof combine to create a light and airy interior that highlights the exceptional interior package. \n\nIts no surprise that the Jaguar I-PACE has won over 80 global awards, including 2019 World Car of the Year, World Car Design of the Year, and World Green Car in 2019.\n\n\u2014\n\n@jaguar_india #Jaguar #IPACE #FutureIsElectric #JaguarElectrifies #ElectricVehicle #EV #CleanEnergy #ad"}}]},"shortcode":"CNWrxkUjx3u","edge_media_to_comment":{"count":18},"taken_at_timestamp":1617776364,"dimensions":{"height":1350,"width":1080},"display_url":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/p1080x1080/169755545_951238285650918_933458859421283192_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=X_oeHilkCTQAX8qsJn8\u0026edm=ABZsPh
